import {
    IonContent,
    IonPage,
    IonHeader,
    IonToolbar,
    IonTitle,
    IonTextarea,
    IonItem,
    IonLabel,
    IonButton,
  } from '@ionic/react';
import React, { useState } from 'react';
import HomePage from './HomePage';

  const AddEntryPage: React.FC = () => {
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [status, setStatus] = useState({loading:false, error:false});

    return (
      <IonPage>
        <IonHeader>
            <IonToolbar>
                <IonTitle>Add Entry Page</IonTitle>
            </IonToolbar>
        </IonHeader>
        <IonContent className="ion-padding">

            <IonItem>
                <IonLabel position="floating">Title</IonLabel>
                <IonTextarea value={title} onIonChange={e => setTitle(e.detail.value!)}></IonTextarea>
            </IonItem>

            <IonItem>
                <IonLabel position="floating">Description</IonLabel>
                <IonTextarea value={description} onIonChange={e => setDescription(e.detail.value!)}></IonTextarea>
            </IonItem>

            <IonItem>
                <IonButton expand="block" routerLink="/my/entries">Add Entry</IonButton>
            </IonItem>

        </IonContent>
      </IonPage>
    );
  };

  export default AddEntryPage;
